"use strict";
var log_1 = require('server/lib/log');
exports.render = function (session, data) {
    var json = JSON.stringify(data);
    session.response.writeHead(0, { 'Content-Type': 'application/json; charset=UTF-8' });
    session.response.write(json);
    session.response.end();
    log_1.default.debug("json-render.render(" + json + ")");
};
